import { React, lazy } from "react";
function Card({ details }) {
  const { title, url } = details;
  console.log(details);
  return (
    <div style={container}>
      <div style={cardHolder}>
        <h1
          style={{
            display: "flex",
            flex: 1,
            justifyContent: "center",
            alignContent: "center",
          }}
        >
          {title}
        </h1>
        <img
          loading="lazy"
          src={url}
          style={{ width: "800px", height: "500px", margin: "20px" }}
        />
      </div>
    </div>
  );
}

const container = {
  display: "flex",
  flex: 1,
  justifyContent: "center",
  alignContent: "center",
  flexDirection: "column",
  width: "100%",
  alignItems: "center",
};

const cardHolder = {
  display: "flex",
  flex: 1,
  justifyContent: "center",
  alignContent: "center",
  border: "1px solid",
  borderRadius: "20px",
  margin: "20px",
  alignItems: "center",
  width: "60%",
  flexDirection: "column",
};
export default Card;
